import './App.css';

function App() {
  const [response, setResponse] = useState("");

  const api_ex = () => {
    fetch('http://127.0.0.1:5000/')
        .then(response => response.json())
        .then(data => this.setState({ totalReactPackages: data.total }));
  }


  return (
    <div className="App">
      <header>Hi!</header>
    </div>
  );
}

export default App;
